Deze video is bedoelt om met elkaar in gesprek te gaan, als jouw bedoeling is om haat te verspreiden is dit niet de plek. Voel je alsjeblieft vrij om vragen te stellen, en als je vragen kan beantwoorden, doe dat dan vooral. Maar ga ook zelf op onderzoek uit! 

DEFINITIES
Racisme - Racisme is een groep om raciale redenen minderwaardig behandelen of daarover vernederende uitspraken doen. In deze context gaat dit om racisme naar donkere mensen. Overigens kan iedereen gediscrimineerd worden. 

White Privilege (wit privilege) - Het privilege dat je als mens met witte huidkleur in het leven hebt. Het zegt dat wat de struggles in het leven ook zijn, je huidskleur daar nooit een obstakel is geweest. Het zegt dus niet dat je leven altijd maar makkelijk is als mens met witte huid. 

Black Lives Matter - een beweging die opstaat tegen onrecht naar donkere mensen toe, onrecht die vaak vooral in Amerika uitloopt op de dood van donkere mensen door bijvoorbeeld Politie agenten. De Term All Lives Matter wordt niet gebruikt om dit belang te benadrukken om de volgende reden. Als er een huis in de fik staat, gaan we niet alle huizen blussen. We blussen het huis met het probleem. We zeggen Black Lives Matter. Totdat op een gegeven moment hopelijk ALL lives Will matter. 

